CREATE PROCEDURE [dbo].[spCurrencyValues_Insert]
	@financialFactId int,
	@value money
AS

begin set nocount on;
if not exists (select 1 from dbo.FinancialAttributes where Title = @title) begin insert into dbo.FinancialAttributes (Title, Label, Description) values (@title, @label, @description) end
select top 1 [Id], [Title], [Label], [Description] from dbo.FinancialAttributes where Title = @title end

CREATE PROCEDURE [dbo].[spFinancialAttributes_Insert]
	@title nvarchar(500),
	@label nvarchar(1000),
	@description nvarchar(MAX)
AS

begin set nocount on;
WITH MarketCap2024 AS ( SELECT s.CIK, s.Ticker, ff.FiscalYear, ff.EndDate, cv.Value AS CurrencyValue FROM dbo.StockFinances sf INNER JOIN dbo.Stocks s ON sf.StockId = s.Id INNER JOIN dbo.FinancialAttributes fa ON sf.FinancialAttributeId = fa.Id INNER JOIN dbo.FinancialFacts ff ON sf.FinancialFactId = ff.Id INNER JOIN dbo.Units u ON ff.UnitId = u.Id LEFT JOIN dbo.CurrencyValues cv ON sf.FinancialFactId = cv.FinancialFactId LEFT JOIN dbo.ShareValues sv ON sf.FinancialFactId = sv.FinancialFactId LEFT JOIN dbo.CurrencyPerShareValues cpsv ON sf.FinancialFactId = cpsv.FinancialFactId WHERE ff.FiscalYear = @labelYear AND fa.Title = 'MarketCapitalization' ), DistinctStocks AS ( SELECT s.Id, s.CIK, s.Ticker, s.Name FROM dbo.StockFinances sf INNER JOIN dbo.Stocks s ON sf.StockId = s.Id INNER JOIN dbo.FinancialAttributes fa ON sf.FinancialAttributeId = fa.Id INNER JOIN dbo.FinancialFacts ff ON sf.FinancialFactId = ff.Id WHERE fa.Title IN ( 'RevenueFromContractWithCustomerExcludingAssessedTax', 'NetIncomeLoss', 'OperatingIncomeLoss', 'AccountsReceivableNetCurrent', 'AssetsCurrent', 'LiabilitiesCurrent', 'StockholdersEquity', 'CashAndCashEquivalentsAtCarryingValue' ) AND (ff.Form = '10-K' OR ff.Form = '20-F' OR ff.Form = '10-K/A' OR ff.Form IS NULL) AND ff.EndDate LIKE '%' + @year + '%' AND ff.FiscalYear = @year GROUP BY s.Id, s.CIK, s.Ticker, s.Name HAVING COUNT(DISTINCT fa.Title) = 8 -- Number of fa.Title values in the IN list minus MarketCapitalization )
SELECT ds.CIK, ds.Ticker, ff.FiscalYear, MAX(CASE WHEN fa.Title = 'MarketCapitalization' THEN m.CurrencyValue END) AS NextYearMarketCap, MAX(CASE WHEN fa.Title = 'RevenueFromContractWithCustomerExcludingAssessedTax' THEN cv.Value END) AS NetSales, MAX(CASE WHEN fa.Title = 'NetIncomeLoss' THEN cv.Value END) AS NetIncomeLoss, MAX(CASE WHEN fa.Title = 'OperatingIncomeLoss' THEN cv.Value END) AS OperatingIncomeLoss, MAX(CASE WHEN fa.Title = 'AccountsReceivableNetCurrent' THEN cv.Value END) AS AccountsReceivableNetCurrent, MAX(CASE WHEN fa.Title = 'AssetsCurrent' THEN cv.Value END) AS AssetsCurrent, MAX(CASE WHEN fa.Title = 'LiabilitiesCurrent' THEN cv.Value END) AS LiabilitiesCurrent, MAX(CASE WHEN fa.Title = 'StockholdersEquity' THEN cv.Value END) AS StockholdersEquity, MAX(CASE WHEN fa.Title = 'CashAndCashEquivalentsAtCarryingValue' THEN cv.Value END) AS CashAndCashEquivalentsAtCarryingValue FROM DistinctStocks ds INNER JOIN dbo.StockFinances sf ON sf.StockId = ds.Id INNER JOIN dbo.FinancialAttributes fa ON sf.FinancialAttributeId = fa.Id INNER JOIN dbo.FinancialFacts ff ON sf.FinancialFactId = ff.Id INNER JOIN dbo.Units u ON ff.UnitId = u.Id LEFT JOIN dbo.CurrencyValues cv ON sf.FinancialFactId = cv.FinancialFactId LEFT JOIN MarketCap2024 m ON ds.Ticker = m.Ticker WHERE fa.Title IN ( 'MarketCapitalization','RevenueFromContractWithCustomerExcludingAssessedTax', 'NetIncomeLoss', 'OperatingIncomeLoss', 'AccountsReceivableNetCurrent', 'AssetsCurrent', 'LiabilitiesCurrent', 'StockholdersEquity', 'CashAndCashEquivalentsAtCarryingValue' ) AND (ff.Form = '10-K' OR ff.Form = '20-F' OR ff.Form = '10-K/A' OR ff.Form IS NULL) AND ff.EndDate LIKE '%' + @year + '%' AND ff.FiscalYear = @year GROUP BY ds.CIK, ds.Ticker, ff.FiscalYear Having MAX(CASE WHEN fa.Title = 'MarketCapitalization' THEN m.CurrencyValue END) IS NOT NULL ORDER BY ds.Ticker; end

CREATE PROCEDURE [dbo].[spFinancialData_GetStocksWithFeatureList]
	@year char(4),
    @labelYear char(4)
AS

begin set nocount on;
WITH RankedFinances AS ( SELECT s.Ticker, s.Name, fa.Title, fa.Label, ff.FiscalYear, fac.DisplayName, cv.Value AS CurrencyValue, ROW_NUMBER() OVER ( PARTITION BY fa.Title, ff.FiscalYear ORDER BY ff.EndDate DESC ) AS RowNum FROM dbo.StockFinances sf INNER JOIN dbo.Stocks s ON sf.StockId = s.Id INNER JOIN dbo.FinancialAttributes fa ON sf.FinancialAttributeId = fa.Id INNER JOIN dbo.FinancialFacts ff ON sf.FinancialFactId = ff.Id INNER JOIN dbo.Units u ON ff.UnitId = u.Id LEFT JOIN dbo.CurrencyValues cv ON sf.FinancialFactId = cv.FinancialFactId LEFT JOIN dbo.ShareValues sv ON sf.FinancialFactId = sv.FinancialFactId LEFT JOIN dbo.CurrencyPerShareValues cpsv ON sf.FinancialFactId = cpsv.FinancialFactId INNER JOIN dbo.FinancialAttributeConfig fac on fac.FinancialAttributeId = fa.Id WHERE s.Id = @stockId AND (ff.Form LIKE '%10-K%' OR ff.Form LIKE '%20-F%') AND u.Type = 'USD' ) SELECT Ticker, Name, Title, Label, DisplayName, FiscalYear, CurrencyValue FROM RankedFinances WHERE RowNum = 1 ORDER BY Title, FiscalYear DESC;
end

CREATE PROCEDURE [dbo].[spFinancialDataApi_GetAnnual]
	@stockId int
AS

begin set nocount on;
SELECT fa.Title, fa.Label, fac.DisplayName, ff.Frame, cv.Value AS CurrencyValue FROM dbo.StockFinances sf INNER JOIN dbo.Stocks s ON sf.StockId = s.Id INNER JOIN dbo.FinancialAttributes fa ON sf.FinancialAttributeId = fa.Id INNER JOIN dbo.FinancialFacts ff ON sf.FinancialFactId = ff.Id INNER JOIN dbo.Units u ON ff.UnitId = u.Id LEFT JOIN dbo.CurrencyValues cv ON sf.FinancialFactId = cv.FinancialFactId LEFT JOIN dbo.ShareValues sv ON sf.FinancialFactId = sv.FinancialFactId LEFT JOIN dbo.CurrencyPerShareValues cpsv ON sf.FinancialFactId = cpsv.FinancialFactId INNER JOIN dbo.FinancialAttributeConfig fac on fac.FinancialAttributeId = fa.Id WHERE s.Id = @stockId AND u.Type = 'USD' AND Frame IS NOT NULL ORDER BY fa.Title, FiscalYear DESC, Frame DESC;
end

